import './ContactPage.scss';

function ContactPage() {
    return (
        <article className="contact-page">
            <div className="contact-page__wrap">
                <section className="contact-page__section">
                    <h1 className="contact-page__title">Contact</h1>
                    <p className="contact-page__txt">You can reach out via the form below. If forms aren't really your thing, here's my email adress: <a className="contact-page__link" href="mailto:laurievilleton@gmail.com?subject=Hello, from your website!">laurievilleton@gmail.com</a>.</p>
                </section>
            </div>
        </article>
    );
}

export default ContactPage;
